import React from "react";
import s from "./Home.module.css";
const Home = (props) => {
  return (
    <div className={s.homepagestyle}>
      <h1>Welcome to our bank</h1>
      <div className={s.creditcard}>
        <div className={s.creditnumber}>
          <label for="ccn">Credit Card Number:</label>
          <input
            type="text"
            pattern="[0-9]*"
            inputmode="numeric"
            placeholder="xxxx-xxxx-xxxx-xxxx"
          >
          </input>
        </div>
        <div class="cvvinput">
          <label for="ccn">CVV:</label>
          <input type="text" placeholder="CVV" />
        </div>
      
     
      < div className = {s.validthru}>
      <input type="date" id="start" name="trip-start"
              min="11.05.2022" max="1-12-31"/>
    
       </div>
    </div>
    </div>
  );
};
export default Home;
